import React from "react";
import { Link, Router } from "react-router-dom";
import { Switch, Route } from "react-router-dom";

function Warm() {
  return (
    <Router>
      <div className="row warmcontent">
        <div className="leftbar">
          <Link to="/"> &#60; Back </Link>
          <Link to="#">Logic</Link>
        </div>
        <div className="mainsection">
          <Switch>
            <Route path="/warm/p1" exact component={prob1} />
            <Route path="/warm" component={Warm} />
          </Switch>
        </div>
        <div className="rightbar">
          <div className="lesson">
            <h5>Lesson 1</h5>
          </div>
          <h2>WARMUP PUZZLES</h2>
          <div className="proppicker row">
            <div
              style={{
                cursor: "pointer",
                marginRight: "2rem",
                fontSize: "3rem",
              }}
            >
              &#60;
            </div>
            <Link to="/warm/p1" className="prop_marker">
              {" "}
              &nbsp; &nbsp;
            </Link>
            <Link to="/warm/p2" className="prop_marker">
              {" "}
              &nbsp; &nbsp;
            </Link>
            <Link
              to="/warm/p3"
              className="prop_marker"
              style={{ background: "black" }}
            >
              {" "}
              &nbsp; &nbsp;
            </Link>
            <Link to="/warm/p4" className="prop_marker">
              {" "}
              &nbsp; &nbsp;
            </Link>
            <Link to="/warm/p5" className="prop_marker">
              {" "}
              &nbsp; &nbsp;
            </Link>
            <Link
              to="/warm/p6"
              className="prop_marker"
              style={{ background: "black" }}
            >
              {" "}
              &nbsp; &nbsp;
            </Link>
            <div
              style={{
                cursor: "pointer",
                marginLeft: "2rem",
                fontSize: "3rem",
              }}
            >
              &#62;
            </div>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default Warm;
